const INITSTATE =  {
    account:{
        familyName: '',
        givenName: '',
        Sex: '',
        DateOfBirth: '',
        CountryOfBirth: '',
        PassportNumber: '',
        CountryOfPassport: ''
    }
}
const userReducer = (state= INITSTATE, action) => {
    switch(action.type){
        case 'FETCH_SAVE_USER':
            console.log("check action: ",action);
            return{
                ...state, account: {
                    familyName: action.payload.familyName
                }
            }
    }
}

